import React, { Component } from 'react';
import '../Styles/Navigation.css';
import github from '../Assets/Icons/github.svg';
import githubHover from '../Assets/Icons/github.svg';
import {Route, Link} from 'react-router-dom';
import About from './Components/About';
class Navigation extends Component {
    state = {  } 
    render() { 
        return (
            <>
                <div className = "NavigationMain">

                    <div className = "leftNavButtons">

                        <a href='#landingMain' id = "navbutton">Home</a>
                        <a href={<Router exact path = "/about" Component = {About} />} id = "navbutton">About</a>
                        <a href='#myWorkMain' id = "navbutton">My Work</a>
                        <a href='#contactForm' id = "navbutton">Contact Me</a>

                    </div>

                    <div className = "rightNavButtons">
                        <a href='#' id = ""><img src = {github}></img></a>
                    </div>

                </div>
            </>
        );
    }
}

export default Navigation;
